"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?18/49/19223/abstract-text/11533352/pubmed\" id=\"11533352\" target=\"_blank\">",
"        11533352",
"       </a>",
"       ]",
"      </span>",
"     </div>",
