var title_f18_49_19227="Treatment of latent TB infection in pregnancy";
var content_f18_49_19227=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F73637&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F73637&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Treatment of latent tuberculosis in pregnancy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       &nbsp;",
"      </td>",
"      <td class=\"subtitle1\">",
"       Adults",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"6\">",
"       Isoniazid",
"      </td>",
"      <td>",
"       Preferred:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       300 mg PO daily for 9 months",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Alternate regimens:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       300 mg PO daily for 6 months",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       900 mg PO twice weekly* for 9 months",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       900 mg PO twice weekly* for 6 months",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pyridoxine&bull;",
"      </td>",
"      <td>",
"       25-50 mg PO daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Alternative to isoniazid:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Rifampin",
"      </td>",
"      <td>",
"       600 mg PO daily for 4 months",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Twice weekly regimens must be administered with directly observed therapy (DOT).",
"     <br>",
"      &bull; Pyridoxine should be administered to pregnant women as well as to infants of breastfeeding mothers receiving isoniazid.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
