var title_f18_49_19228="ACG first-line H pylori regimens";
var content_f18_49_19228=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F65237&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F65237&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    American College of Gastroenterology first-line",
"    <em>",
"     H. pylori",
"    </em>",
"    regimens (adult dosing, oral administration)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Patients who are",
"        <strong>",
"         not",
"        </strong>",
"        allergic to penicillin and have not previously received a macrolide",
"       </td>",
"       <td>",
"        Standard dose PPI* twice daily (or esomeprazole 40 mg once daily) plus clarithromycin 500 mg twice daily, and amoxicillin 1000 mg twice daily for 10-14 days",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Patients who are allergic to penicillin, and who have not previously received a macrolide or metronidazole or are unable to tolerate bismuth quadruple therapy",
"       </td>",
"       <td>",
"        Standard dose PPI twice daily, clarithromycin 500 mg twice daily, metronidazole 500 mg twice daily for 10-14 days",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patients who are allergic to penicillin or failed one course (above) of",
"        <em>",
"         H. pylori",
"        </em>",
"        treatment",
"       </td>",
"       <td>",
"        <p>",
"         Bismuth subsalicylate 525 mg four times daily, metronidazole 250 mg four times daily, tetracycline 500 mg four times daily, standard dose PPI* twice daily for 10-14 days",
"         <sup>",
"          &Delta;",
"         </sup>",
"        </p>",
"        <p>",
"         <strong>",
"          OR",
"         </strong>",
"        </p>",
"        Bismuth subcitrate 420 mg four times daily, metronidazole 375 mg four times daily, tetracycline 375 mg four times daily",
"        <sup>",
"         &loz;",
"        </sup>",
"        , standard dose PPI* twice daily for 10-14 days",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     &nbsp;",
"    </p>",
"    <div class=\"footnotes\">",
"     <em>",
"      H. pylori",
"     </em>",
"     :",
"     <em>",
"      Helicobacter pylori",
"     </em>",
"     ; PPI: proton pump inhibitor.",
"     <br>",
"      * Lansoprazole 30 mg twice daily, omeprazole 20 mg twice daily, pantoprazole 40 mg twice daily, or rabeprazole 20 mg twice daily.",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       Eradication rates of 70 to 85 percent.",
"       <br>",
"        &Delta; Eradication rates of 75 to 90 percent.",
"        <br>",
"         <font class=\"lozenge\">",
"          &loz;",
"         </font>",
"         A combination preparation of bismuth subcitrate-metronidazole-tetracycline is available in the United States (trade name Pylera).",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Table adapted from data published in: Chey WD, Wong BCY. American College of Gastroenterology Guideline on the Management of",
"     <em>",
"      Helicobacter pylori",
"     </em>",
"     Infection. Am J Gastroenterol 2007; 102:1808.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f18_49_19228=[""].join("\n");
