var title_f18_49_19229="Heparin protocol I";
var content_f18_49_19229=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F66081%7EPULM%2F72792&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F66081%7EPULM%2F72792&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Example of a non-weight-based intravenous heparin protocol: Part I",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Initial intravenous heparin bolus: 5000 units.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Continuous intravenous heparin infusion: commence at 42 mL/hour of 20,000 units (1680 units/hour) in 500 mL of two-thirds dextrose and one-third saline (a 24-hour heparin dose of 40,320 units), except in the following patients, in whom heparin infusion will be commenced at a rate of 31 mL/hour (1240 units/hour) (ie, a 24-hour dose of 29,760 units).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Patients who have undergone surgery within the previous two weeks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Patients with a previous history of peptic ulcer disease, gastrointestinal or genitourinary bleeding.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Patients with (thrombotic) stroke within the previous two weeks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Patients with a platelet count &lt;150,000/microL.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Patients with miscellaneous reasons for a high risk of bleeding (eg, hepatic failure, renal failure, or vitamin K deficiency).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Heparin dose adjusted using the aPTT. The aPTT is performed in all patients as outlined below:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4 to 6 hours after commencing heparin; the heparin dose is then adjusted according to the nomogram shown in Heparin Protocol-II until the aPTT is within the therapeutic range.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Thereafter, the aPTT will be performed once daily. If the value is outside the therapeutic range, the heparin dose is then adjusted according to the nomogram shown in Heparin Protocol-II until the aPTT is within the therapeutic range.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Hull RD, Raskob GE, Rosenbloom D, et al. Optimal therapeutic level of heparin therapy in patients with venous thrombosis. Arch Intern Med 1992; 152:1589.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Example of a non-weight-based intravenous heparin protocol: Part II titration based upon the activated partial thromboplastin time",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"4\">",
"        IV infusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        aPTT",
"       </td>",
"       <td class=\"subtitle2\">",
"        Rate change, mL/hour*",
"       </td>",
"       <td class=\"subtitle2\">",
"        Dose change, units/24-hour",
"       </td>",
"       <td class=\"subtitle2\">",
"        Additional action",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &le;45",
"       </td>",
"       <td>",
"        +6",
"       </td>",
"       <td>",
"        +5760",
"       </td>",
"       <td>",
"        Repeated aPTT",
"        <sup>",
"         &bull;",
"        </sup>",
"        in 4 to 6 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        46 to 54",
"       </td>",
"       <td>",
"        +3",
"       </td>",
"       <td>",
"        +2880",
"       </td>",
"       <td>",
"        Repeated aPTT in 4 to 6 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        55 to 85",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        None",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        86 to 110",
"       </td>",
"       <td>",
"        -3",
"       </td>",
"       <td>",
"        -2880",
"       </td>",
"       <td>",
"        Stop heparin sodium treatment for 1 hour; repeated aPTT 4 to 6 hours after restarting heparin treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;110",
"       </td>",
"       <td>",
"        -6",
"       </td>",
"       <td>",
"        -5760",
"       </td>",
"       <td>",
"        Stop heparin treatment for 1 hour; repeated aPTT 4 to 6 hours after restarting heparin treatment",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    NOTE: This table reflects the original aPTT ranges, bolus sizes, and suggested changes in infusion rate that were present at the time this study was performed. The therapeutic ranges (ie, relationship between the aPTT and anti-factor Xa activity), initial and subsequent bolus sizes, and sizes of the infusion rate changes, as well as dosing differences depending on the disorder under treatment (eg, venous thromboembolism, stroke, acute coronary syndrome) should be established separately for each institution.",
"    <div class=\"footnotes\">",
"     aPTT: activated partial thromboplastin time; IV: intravenous.",
"     <br/>",
"     * Heparin sodium concentration, 20,000 units in 500 mL = 40 units/mL.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     With the use of Actin-FS thromboplastin reagent (Dade, Mississauga, Ontario).",
"     <br/>",
"     &Delta; During the first 24 hours, repeated aPTT in 4 to 6 hours. Thereafter, the aPTT will be determined once daily, unless subtherapeutic.",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Hull RD, Raskob GE, Rosenbloom D, et al. Optimal therapeutic level of heparin therapy in patients with venous thrombosis. Arch Intern Med 1992; 152:1589.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
